function Categories({items,onClickItem}) {
  const state = React.
  return (
   <div className="categories">
         <ul>
           <li className="active">Все</li>         
            {items.map((name,Index)=>
              (<li onClick={()=> onClickItem(name)} key={`${name}_${Index}`}>{name}</li>
            ))} 
         </ul>
    </div>
  )
}

export default Categories
